import React from 'react';
import OutputScreenRow from './outputScreenRow.js';
import '../index.css'

const OutputScreen = (props) => {
  return (
    <div>
      <OutputScreenRow className="screen" value = {props.question}/>
      <OutputScreenRow className="screen" value = {props.answer}/>
    </div>
  )
}

export default OutputScreen;
